// src/AppRoutes.jsx
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './context/AuthContext';
import Layout from './components/Layout';
import Login from './pages/Login';
import Unauthorized from './pages/Unauthorized';

// ÿµŸÅÿ≠ÿßÿ™ ÿßŸÑŸÖÿØŸäÿ±
import AdminDashboard from './pages/admin/Dashboard'; 
import UsersManagement from './pages/admin/UsersManagement';
import BranchesManagement from './pages/admin/BranchesManagement';
import RentalsManagement from './pages/admin/RentalsManagement';
import RentalsRevenueAnalysis from './pages/admin/RentalsRevenueAnalysis';
import Settings from './pages/admin/Settings';
import GamesManagement from './pages/admin/GamesManagement';

// ÿµŸÅÿ≠ÿßÿ™ ÿßŸÑŸÖŸàÿ∏ŸÅ
import Rentals from './pages/employee/Rentals';

const ProtectedRoute = ({ children, allowedRoles = [] }) => {
  const { isAuthenticated, user, loading } = useAuth();
  
  console.log('üîê ProtectedRoute - isAuthenticated:', isAuthenticated);
  console.log('üîê ProtectedRoute - user:', user);
  console.log('üîê ProtectedRoute - allowedRoles:', allowedRoles);
  
  if (loading) {
    return <div className="loading-screen">ÿ¨ÿßÿ±Ÿä ÿßŸÑÿ™ÿ≠ŸÖŸäŸÑ...</div>;
  }
  
  if (!isAuthenticated) {
    console.log('‚õî ÿ∫Ÿäÿ± ŸÖÿµÿßÿØŸÇÿå ÿ™Ÿàÿ¨ŸäŸá ÿ•ŸÑŸâ /login');
    return <Navigate to="/login" />;
  }
  
  // ‚úÖ ÿ™ÿ≠ŸàŸäŸÑ ÿßŸÑÿ£ÿØŸàÿßÿ± ÿßŸÑÿπÿ±ÿ®Ÿäÿ© ÿ•ŸÑŸâ ÿ•ŸÜÿ¨ŸÑŸäÿ≤Ÿäÿ©
  const normalizedUserRole = (() => {
    const roleMap = {
      'ŸÖÿØŸäÿ±': 'admin',
      'ŸÖÿ¥ÿ±ŸÅ': 'manager',
      'ŸÖŸàÿ∏ŸÅ': 'employee'
    };
    return roleMap[user?.role] || user?.role;
  })();
  
  // ‚úÖ ÿßŸÑŸÖÿØŸäÿ± (admin) ŸäŸÖŸÉŸÜŸá ÿßŸÑŸàÿµŸàŸÑ ÿ•ŸÑŸâ ÿ¨ŸÖŸäÿπ ÿßŸÑÿµŸÅÿ≠ÿßÿ™
  if (normalizedUserRole === 'admin') {
    console.log('‚úÖ ŸÖÿ≥ÿ™ÿÆÿØŸÖ admin - ŸÖÿ≥ŸÖŸàÿ≠ ŸÑŸá ÿ®ÿßŸÑŸàÿµŸàŸÑ');
    return children;
  }
  
  // ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿßŸÑÿµŸÑÿßÿ≠Ÿäÿßÿ™ ŸÑŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖŸäŸÜ ÿßŸÑÿπÿßÿØŸäŸäŸÜ
  if (allowedRoles.length > 0) {
    const normalizedAllowedRoles = allowedRoles.map(role => {
      const roleMap = {
        'ŸÖÿØŸäÿ±': 'admin',
        'ŸÖÿ¥ÿ±ŸÅ': 'manager',
        'ŸÖŸàÿ∏ŸÅ': 'employee'
      };
      return roleMap[role] || role;
